var StockNoteApiDocumentation = require('stock_note_api_documentation');

var api = new StockNoteApiDocumentation.HistoricalCandleDataApi()

var xSessionToken = "7c34ca4f097e4690de486969d6c60f62"; // {String} Session token that should be used with API request is given in the response. It is used as an authenticator. A session token is valid for 24 hours or until a new login request is given, where you a new session token will be generated and the previous one will get expired.

var symbolName = "TCS"; // {String} Symbol name of the scrip.

var fromDate = "2020-09-01"; // {String} From date in yyyy-MM-dd

var opts = { 
  'exchange': "exchange_example", // {String} Name of the exchange.Valid exchanges values (BSE/ NSE/ NFO/ MCX/ CDS).If the user does not provide an exchange name, by default considered as NSE.For trading with BSE, NFO, CDS and MCX, exchange is mandatory.
  'toDate': "toDate_example" // {String} To date in yyyy-MM-dd
};

var callback = function(error, data, response) {
  if (error) {
    console.error(error);
  } else {
    console.log('API called successfully. Returned data: ' + data);
  }
};
value=api.getHistoricalCandleData(xSessionToken, symbolName, fromDate, opts, callback);
console.log('Historicial Response:'+value)